// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import DataVisualization from './components/DataVisualization';
import ManageData from './components/ManageData';

function App() {
  return (
    <Router>
      <div className="bg-gray-900 text-white min-h-screen">
        <header className="bg-gray-800 p-4">
          <nav className="flex justify-between items-center">
            <h1 className="text-2xl font-bold">DBVision</h1>
            <ul className="flex space-x-4">
              <li>
                <Link to="/" className="hover:text-gray-400">Dashboard</Link>
              </li>
              <li>
                <Link to="/visualization" className="hover:text-gray-400">Data Visualization</Link>
              </li>
              <li>
                <Link to="/manage" className="hover:text-gray-400">Manage Data</Link>
              </li>
            </ul>
          </nav>
        </header>
        <main className="p-6">
          <Routes>
            <Route path="/" element={<Dashboard />} />
            <Route path="/visualization" element={<DataVisualization />} />
            <Route path="/manage" element={<ManageData />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
